import Card from "../Card/Card";
import "./style.css";
import data from "../../assets/data.json";




function CardList() {
  return (
    <div className="cards">

    {data.map(function(item) {
      return (
      <Card 
        name={item.name} 
        price={item.price} 
        discount={item.discount} 
        wight={item.wight} 
        description={item.description} 
        picture={item.picture}
      />)
      }
    )
    }
    </div>
  )
}


export default CardList;
